import Layout from '../components/layout.js';

export default function Profile() {
  return (
    <Layout>
      <section className="paper">
        <article className="paperHead"></article>
        <p>&nbsp;</p>
        <article contenteditable="false">
          <h1>Coming Soon!</h1>
        </article>
      </section>
    </Layout>
  );
}
